import React from "react";

const Card = () => {
  return (
    <div className="w-[380px] h-[300px] mx-5 my-2 p-4  border border-sm bg-white">
      <span className="">01/11/2019</span>
      <h1>A structured approach to deciphering FX and Gold sentiment</h1>
      <p>Market scan across FX & Gold to determine sentiment with accuracy.</p>
      <p>7pm-8:30pm EST</p>
      <div>
        <span>Register Now</span>
      </div>
    </div>
  );
};

export default Card;
